    /* ---------------------------------------------------------------------- */
    /* Portfolio Filter
     /* ---------------------------------------------------------------------- */

    if ($().quicksand) {

        // get the action filter option item on page load
        var $filterType = $('#filter li.active a').attr('class');

        // get and assign the ourHolder element to the
        // $holder varible for use later
        var $holder = $('ul#gallery');

        // clone all items within the pre-assigned $holder element
        var $data = $holder.clone();

        // assign transition parameters
        var $preferences = {
            duration: 500,
            easing: 'easeInQuad'
        };

        function doQuickSandFilter(element) {
            if (isIE10()) {
                $('video').each(function () {
                    this.player.pause()
                });
                $('audio').each(function () {
                    this.player.pause()
                });
            }
            // reset the active class on all the buttons
            $('#filter li').removeClass('active');
            // assign the class of the clicked filter option
            // element to our $filterType variable
            var $filterType = $(element).attr('class');
            $(element).parent().addClass('active');
            if ($filterType == 'all') {
                // assign all li items to the $filteredData var when
                // the 'All' filter option is clicked
                var $filteredData = $data.find('li.entry');
            }
            else {
                // find all li elements that have our required $filterType
                // values for the data-type element
                var $filteredData = $data.find('li[data-type~=' + $filterType + ']');
            }
            // callback function
            $holder.quicksand($filteredData, $preferences, function () {
                lightbox();
                initAllEntrySliders(false);
                resizeVideoEmbed();
                initAllPlayers();
            });
        }

        function initQuickSand() {
            // attempt to call Quicksand when a filter option
            // item is clicked
            $('#filter li a').click(function (e) {
                doQuickSandFilter(this);
            });

            $('#filter li a').each(function () {
                var $this = $(this);
                var link = window.location.href;
                var index = link.indexOf('filter=');
                if (index > 0) {
                    var id = link.substring(index + 7, link.length);
                    if ('#' + id == $this.attr('href')) {
                        var timer = window.setTimeout(function () {
                            window.clearTimeout(timer);
                            doQuickSandFilter($this);
                        }, 200);
                    }
                }
            });
        }

        initQuickSand();
    }

